import React, { useState, useContext } from 'react';
  import { Container, Form, Button, Alert, Row, Col } from 'react-bootstrap';
  import { AppContext } from '../App';

  const AddSales = () => {
    const { sales, setSales, setalertMessage } = useContext(AppContext);
    const [formData, setFormData] = useState({
      customer: '',
      plate: '',
      fs: '',
      quantities: { '8mm': 0, '10mm': 0, '12mm': 0, '14mm': 0, '16mm': 0, '20mm': 0, '24mm': 0, '32mm': 0 },
      date: new Date().toISOString().split('T')[0],
    });

    const handleChange = (e) => {
      const { name, value } = e.target;
      setFormData({ ...formData, [name]: value });
    };

    const handleQuantityChange = (e) => {
      const { name, value } = e.target;
      setFormData({
        ...formData,
        quantities: { ...formData.quantities, [name]: parseInt(value) || 0 },
      });
    };

    const handleSubmit = (e) => {
      e.preventDefault();
      setSales([...sales, { ...formData, id: Date.now(), shipped: false }]);
      setalertMessage('Registered');
      setTimeout(() => setAlertMessage(''), 3000);
      setFormData({
        customer: '',
        plate: '',
        fs: '',
        quantities: { '8mm': 0, '10mm': 0, '12mm': 0, '14mm': 0, '16mm': 0, '20mm': 0, '24mm': 0, '32mm': 0 },
        date: new Date().toISOString().split('T')[0],
      });
    };

    return (
      <Container className="mt-5">
        <h2>Add Sales</h2>
        { <Alert variant="success">Registered</Alert>}
        <Form onSubmit={handleSubmit}>
          <Row>
            <Col md={4}>
              <Form.Group>
                <Form.Label>Customer Name</Form.Label>
                <Form.Control type="text" name="customer" value={formData.customer} onChange={handleChange} required />
              </Form.Group>
            </Col>
            <Col md={4}>
              <Form.Group>
                <Form.Label>Plate Number</Form.Label>
                <Form.Control type="text" name="plate" value={formData.plate} onChange={handleChange} required />
              </Form.Group>
            </Col>
            <Col md={4}>
              <Form.Group>
                <Form.Label>FS Number</Form.Label>
                <Form.Control type="text" name="fs" value={formData.fs} onChange={handleChange} required />
              </Form.Group>
            </Col>
          </Row>
          <Row className="mt-3">
            {Object.keys(formData.quantities).map((size) => (
              <Col md={3} key={size}>
                <Form.Group>
                  <Form.Label>{size}</Form.Label>
                  <Form.Control type="number" name={size} value={formData.quantities[size]} onChange={handleQuantityChange} min="0" />
                </Form.Group>
              </Col>
            ))}
          </Row>
          <Form.Group className="mt-3">
            <Form.Label>Date</Form.Label>
            <Form.Control type="date" name="date" value={formData.date} onChange={handleChange} required />
          </Form.Group>
          <Button type="submit" variant="primary" className="mt-3">Submit</Button>
        </Form>
      </Container>
    );
  };

  export default AddSales;
